import React, { useEffect, useState, useRef } from 'react';
import { FiBook } from 'react-icons/fi';
import { createStyles, makeStyles, Theme } from '@material-ui/core/styles';

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    style: {
      padding: '10px',
      color: 'rgb(136,141,144)',
      cursor: 'pointer',
      '&:hover': {
        backgroundColor: 'rgb(225,225,225)',
      },
    },
  })
);

export default function EditorTitle(props: any) {
  const classes = useStyles();

  return (
    <>
      <div style={classes.style}>
        <span style={{ padding: '2px 3px 0px 3px', verticalAlign: 'middle' }}>
          <FiBook />
        </span>
        <span style={{ padding: '0px 3px 2px 3px' }}>
          {props.notebooks[props.notebook].title}
        </span>
      </div>
    </>
  );
}
